import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";

const HomeContent = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Link to="/films" className="colHome">FILMS</Link>
        </Col>
        <Col>
          <Link to="/actors" className="colHome">ACTORS</Link>
        </Col>
      </Row>
    </Container>
  )
}

export default HomeContent;
